==Trivia==
*Gabooty's name is probably drawn from that of the nation of {{wp|Djibouti}} (jih-boo-tee), which is located in Africa. Karamja is based on the jungles of Africa and the Caribbean, so it is probably a reference to that relation. Despite this, Djibouti is located on the east coast of Africa and contains no jungles, instead containing a very {{wp|Arid|arid climate}}.

